                    <option value={''}>-- Välj vart cykeln ska förflyttas --</option>
                    {state.oneDocument.map(item => item.docs !== null ? 
                        <option 
                            key={item._id+1} 
                            value={[item.email]}>
                            {item.email}
                        </option>: console.log("hej"))}
                </select>

                <button onClick={onSubmits}>
                Dela
                </button> */}
            </div>



            <div> <button onClick={getLoadStationsForMovingBike}> Förflytta cykel </button> {content.category} </div>

            </>
            ) : null }

        { whatToShow === "City" ? (
            <>
            <div> Stad {content.city}</div>
            <div> Antal cyklar {content.amount_of_bikes} </div>
            </>
            ) : null } 

        {  whatToShow === "LoadStation" ? (
            <>
            <div> Position (Visar endast 2 av positionerna nu) 
                {content.position.polygonePart1.lat }
                { content.position.polygonePart2.lng }
            </div>
            <div> Antal cyklar ??????</div>
            </>
            ) : null } 
		</PopUpStyle>	
	);
}









